глава Украины прибыл в Вашингтон для подписания соглашения по добыче редкоземельных металлов — аналитики заявляли, что она может привести к ускорению мирных переговоров;

В последний раз Трамп встречался с главой Киева в сентябре 2024 года. Зеленский после начала переговоров сделал ряд заявлений:
➖ Я думаю, что президент США не остановит поддержку Украине;
➖ Путин должен заплатить за восстановление Украины;
➖ Я понимаю, на что готова Европа. Я хочу спросить Трампа, на что готовы США;
➖ Если Трамп принесет мир в Украину, он будет на уровне Джорджа Вашингтона.

Дональд Трамп также выделил несколько моментов:
➖ Украина не вернется к боевым действиям;
➖ Всегда нужно идти на компромиссы и, безусловно, Зеленскому придется идти на компромиссы;
➖ Мы не говорим о гарантиях безопасности. Мы все ждем быстрого окончания этой войны.

